import { Routes, Route } from "react-router-dom";

import "./App.css";

import Form from "./pages/Form";

function App() {
  return (
    <div className="App">
      <h1>Hola</h1>
      <Routes>
        <Route path="/loading" element={<p>Landing page</p>} />
        <Route path="/formulario" element={<Form />} />
      </Routes>
    </div>
  );
}

export default App;
